import React, { Component }from 'react';

import {ContentWrap} from "../list_projects_page/styles"


import ProjectList from "../list_projects_page/ProjectList"
import ProjectFilters from "../list_projects_page/ProjectFilters"


class Content extends Component{
    render() {

        return (
            
            <ContentWrap>
                 <ProjectList/>
                 <ProjectFilters/>
             </ContentWrap>
        )

    }
}

export default Content
